import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { requestFCMToken, listenForMessages } from './services/firebase';
import FlightStatus from './components/FlightStatus';

function App() {
    const [flights, setFlights] = useState([]);

    useEffect(() => {
        const fetchFlightStatus = async () => {
            const response = await axios.get('http://localhost:5000/get_flight_status');
            setFlights(response.data);
        };

        fetchFlightStatus();

        const token = requestFCMToken();
        listenForMessages((payload) => {
            console.log('Message received. ', payload);
        });
    }, []);

    return (
        <div>
            <h1>Flight Status App</h1>
            <FlightStatus flights={flights} />
        </div>
    );
}

export default App;
